import React from 'react';
import chocolate from "../imgs/chocolate-bar.png";
import cacao from "../imgs/cocoa.png";
import { useState }  from "react";


function Tile(props) {

    const urls = [chocolate, cacao];

    var id = 0;

    function change_id(symbol){
      if (`${symbol}` === "chocolate"){
        id = 0;
      } 
      if (`${symbol}` === "cacao"){
        id = 1;
      }
      return id;
    }

    return (
      <>
      <section className="Tile">
        <p id="p_tile">{props.symbol}</p>
        <img id="img_tile" src={urls[change_id(props.symbol)]} alt="Imagen"></img>
      </section>
      <section className="Tile">
        </section></>

    );
  }

  export default Tile;
